// );

function HatsPage() {
  return(
    <div>
      <h1>Hats Page</h1>
    </div>
  )
}

function Learn() {
  return (
    <div>
      <h1>Learn </h1>
    </div>
  )
}

 function App() {
  return (
    <div>
      <Routes>
        <Route  path='/' element={ <HomePage />} />
        <Route  path='/myapps' element={ <Learn />} />
        <Route path='hatspage/*' element={ <HatsPage/>} />
      </Routes>
    </div>
  );
}

export default App;
